const { uploadPDF } = require('../services/digioService');
const User = require("../models/user.model");
const axios = require('axios');

exports.uploadDigioPDF = async (req, res) => {
  try {
    const {
      file_name = 'default-file.pdf',
      file_data = "",
      userid,
      signers = []
    } = req.body;

    // Fetch user email
    const user = await User.findOne({ _id: userid }, 'email');
 
    
    if (!user) {
      return res.status(404).json({ error: "User not found" });
    }

    // Default signer template
    const defaultSigner = {
      identifier: user.email, //  Add identifier from user email
      name: 'Test User',
      reason: 'Agreement Aadhaar Sign',
      sign_type: 'aadhaar',
      signature_mode: 'otp'
    };

    // Merge each custom signer with defaults + identifier
    const mergedSigners = signers.length > 0
      ? signers.map(signer => ({
          ...defaultSigner,
          ...signer,
          identifier: user.email // Always override identifier with user email
        }))
      : [{ ...defaultSigner }];

    const payload = {
      file_name,
      file_data,
      signers: mergedSigners,
      expire_in_days: 10,
      display_on_page: 'All',
      send_sign_link: true,
      send_signed_file: true,
      create_embedded_link: true
    };

    const result = await uploadPDF(payload);

    // 6. Extract key details for frontend
    const documentId = result.id;
    const identifier = mergedSigners[0].identifier; // email

    //  Return only necessary info for Web SDK
    res.status(200).json({ 
      message: 'PDF uploaded to Digio',
      documentId,
      identifier,
      digioResponse: result // optional, for debug/future use 
    });
  } catch (error) {
    console.error("Upload Error:", error);
    res.status(500).json({ error: error.message });
  }
};

exports.getSignedDocumentLink = async (req, res) => {
  const { docId } = req.params;

  try {
    const response = await axios.get(`https://api.digio.in/v2/client/document/${docId}`, {
      headers: {
        Authorization: 'Basic ' + Buffer.from(`${process.env.DIGIO_CLIENT_ID}:${process.env.DIGIO_CLIENT_SECRET}`).toString('base64'),
      }
    });

    const signedLink = response.data.download_url || response.data.download_link;

    if (!signedLink) {
      return res.status(404).json({ error: "Signed link not available yet. Please try after some time." });
    }

    res.status(200).json({ signedLink });
  } catch (err) {
    console.error("Digio Fetch Error:", err.response?.data || err.message);
    res.status(500).json({ error: "Unable to fetch signed document link" });
  }
};
